import React, { Component, Text } from 'react';
// import '../light.scss';

class Bio extends Component {



  render() {
    return (
      <div className="bio-wrapper">
        {/* <h5>who is she?</h5> */}

      <div className="pinned-wrap">
        <div className="pinned"> 
          <h3>{this.props.title}</h3>
        </div>
      </div>


      <div className="bio-section">
          <p>Hello! My name is Madison & I am a Computer Science student at the University of Florida. Currently I am 
          interning at Ultimate Software (Weston, FL) for Summer 2019. It's my first internship!
          I'm extremely excited to be able to put my knowledge to use in a real-life setting.</p>

          <p>This is my personal website that I was inspired to create after some involvement with front-end 
          design. This is a place where I'll try to post updates about my education / experience / life!</p>


          <p>I am <b>extremely</b> passionate about tech's capability to serve those who are disadvantaged at any level.
          Below you'll be able to see my most recent resume that I hope to expound upon in the near future.</p>
      </div>



    </div>
    );
  }
}
 export default Bio;
